import React from "react";
import Hamburger from "./Hamburger";

const Navbar = () => {
  return (
    <div>
      <Hamburger />
      <style jsx>
        {`
          div {
            display: flex;
            justify-content: flex-end;
          }
        `}
      </style>
    </div>
  );
};

export default Navbar;
